description:
The E-1 Class Northerns from Train Simulator, developed by G-Trax Simulations, is available in SP&amp;S livery with two running numbers, No. 700 and No. 701.

The locomotive is Quick Drive compatible, giving you the freedom to drive the SP&amp;S E-1 Class Northerns on any Quick Drive enabled route for Train Simulator.



Please support the developers and buy some of their content if you can afford it.


If you want to say thanks, contribute and share an addon with the community then email them to us... We will post it on your behalf.

